import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import TableCell   from '@material-ui/core/TableCell';
import CanvasGraph from './CanvasGraphComponent';

const styles = theme => ({
    pointer: {
	cursor:"pointer",
	textAlign: "center",
    },
    nopointer: {
	textAlign: "center",
    },
});
//	padding: "0px";
//	textAlign: "center",
function SeriesCell(props) {
    const { classes,state,onclick,
	    colwhere,rowwhere,
	    elements,plan,...other } = props;
    var cnt=0;
    var lev=-1;
    var elen=elements.length;
    for (var ee=0;ee<elen;ee++) {
        cnt=cnt+elements[ee].cnt;
        lev=Math.max(lev,elements[ee].lev);
    }; 
    var label="";
    if (cnt > 1) {label=cnt;};
    var bgcolor=state.Colors.getLevelColor(lev);
    var cursor=classes.nopointer;
    if (onclick !== undefined) {
	cursor=classes.pointer;
    }
    var title="";
    if (colwhere !== "" && rowwhere !== "") {
	title="("+colwhere+") AND ("+rowwhere+")";
    } else if (colwhere !== "") {
	title=colwhere;
    } else if (rowwhere !== "") {
	title=rowwhere;
    }
    // var bgcolor=state.Colors.getLevelColor(lev);
    // bgcolor={bgcolor} 
    // height={plan.cell}
    // width={plan.width}
    return(
	    <TableCell className={cursor} bgcolor={bgcolor} onClick={onclick} title={title} height={plan.cell} width={plan.width}>
  	       <CanvasGraph {...other} className={cursor} cursor={cursor} classes={classes} state={state} 
	          onclick={onclick} title={title} elements={elements} level={lev} plan={plan}/>  
	    </TableCell>
    );
}



SeriesCell.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SeriesCell);
